import './App.css';
import {Routes,Route,createBrowserRouter,createRoutesFromElements, BrowserRouter} from 'react-router-dom';
import Login from './Login/Login';
import Home from './Home/Home';

function App() {

  // const routers = createBrowserRouter(
  //   createRoutesFromElements(
  //     <Route path='/' element={}>
  //       <Route index element={<Login/>} />
  //       <Route path='/home' element={<Home/>} />
  //     </Route>
  //   )
  // )

  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path='/Login' element={<Login/>} />
          <Route path='/Home' element={<Home/>} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
